import React, {useEffect} from 'react'
import "./Support.css"

export default function Support(props) {
    //console.log('props', props)
    let bob = "using Effectd";

    useEffect(() => {
        if (bob.sel) {
            alert('bob is loaded')
            bob = props.sel.SUPPORTID
        } else {
            alert('bob is waiting')
            bob = "still waiting"
        }

    });

    return (
        <div className="Support">
            <p>
                {bob
}
            </p>
        </div>
    )
}
